import * as React from 'react';
import './App.css';
import {PokemonList} from "./component/PokemonList";
import {Pokemon} from "./model/Pokemon";
import {PokemonType} from "./model/PokemonType";

function App() {
    let pokemonList: Pokemon[] = []

    let electricType: PokemonType = {
        id: 0,
        name: "electriccccc",
    }

    let waterType: PokemonType = {
        id: 0,
        name: "water",
    }

    let pikachu: Pokemon = {
        name: "Pikachu",
        weight: 15,
        height: 10,
        id: 1,
        types: [electricType]
    }



    pokemonList.push(pikachu)

    return (
        <div className="App">
            <body>
            <PokemonList pokemonList={pokemonList}/>
            </body>
        </div>
    );
}

export default App;
